import React from "react";

const HighScore = (props) => {
  return (
    <div>
      <h1>High Score per Country</h1>
      {props.scores.map((x, index) => (
        <div key={index} className="parentDiv">
          <p className="countryName">High Scores:{x.name}</p>
          <div></div>

          ))}
        </div>
      ))}
    </div>
  );
};

export default HighScore;
